import { Component } from '@angular/core';
import { Login } from '../models/Login.model';
import { NgForm } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { ProfileFormService } from '../services/profile-form.service';

@Component({
  selector: 'app-fetch-data',
  templateUrl: './fetch-data.component.html'
})
export class FetchDataComponent {
 
login: Login = new Login();

 constructor(
    private router: Router,
    private service: ProfileFormService,
 ) {}
onSubmit(loginSubmit: NgForm){
  this.service.login(this.login)
  .subscribe({
    next: res => {
      this.router.navigateByUrl('');
    },
    error: err => {
      console.log(err);
    }
  });
}
}

<h1>Login page</h1>
<form #loginSubmit = ngForm (submit)="onSubmit(loginSubmit)">
  <label for="email">Email: </label>
   <input id="email" #email="ngModel" type="email" name="email" [(ngModel)]="login.email">
  <label for="password">Password: </label>
   <input id="password" #password="ngModel" type="password" name="password" [(ngModel)]="login.password">

   <button class="btn btn-success" type="submit">Login</button>
</form>
